parts:
{
  "name": "UBX-NAV-SBAS",
  "class_id": "0x01",
  "message_id": "0x32",
  "description": "This message outputs the status of the SBAS sub system",
  "message_type": "periodic_polled",
  "payload": {
    "length": {
      "variable": {
        "base": 12,
        "formula": "12 + cnt * 12",
        "min": 12
      }
    },
    "fields": [
      {
        "name": "iTOW",
        "byte_offset": 0,
        "data_type": "U4",
        "description": "GPS time of week of the navigation epoch.",
        "unit": "ms"
      },
      {
        "name": "geo",
        "byte_offset": 4,
        "data_type": "U1",
        "description": "PRN Number of the GEO where correction and integrity data is used from"
      },
      {
        "name": "mode",
        "byte_offset": 5,
        "data_type": "U1",
        "description": "SBAS Mode: 0 = Disabled, 1 = Enabled integrity, 3 = Enabled test mode"
      },
      {
        "name": "sys",
        "byte_offset": 6,
        "data_type": "I1",
        "description": "SBAS System (WAAS/EGNOS/...): -1 = Unknown, 0 = WAAS, 1 = EGNOS, 2 = MSAS, 3 = GAGAN, 16 = GPS"
      },
      {
        "name": "service",
        "byte_offset": 7,
        "data_type": "X1",
        "description": "SBAS Services available",
        "bitfield": {
          "bits": [
            {
              "name": "Ranging",
              "bit_start": 0,
              "bit_end": 0,
              "description": "GEO may be used as ranging source"
            },
            {
              "name": "Corrections",
              "bit_start": 1,
              "bit_end": 1,
              "description": "GEO is providing correction data"
            },
            {
              "name": "Integrity",
              "bit_start": 2,
              "bit_end": 2,
              "description": "GEO is providing integrity"
            },
            {
              "name": "Testmode",
              "bit_start": 3,
              "bit_end": 3,
              "description": "GEO is in test mode"
            },
            {
              "name": "Bad",
              "bit_start": 4,
              "bit_end": 4,
              "description": "Problem with signal or broadcast data indicated"
            }
          ]
        }
      },
      {
        "name": "cnt",
        "byte_offset": 8,
        "data_type": "U1",
        "description": "Number of SV data following"
      },
      {
        "name": "statusFlags",
        "byte_offset": 9,
        "data_type": "X1",
        "description": "SBAS status flags",
        "bitfield": {
          "bits": [
            {
              "name": "integrityUsed",
              "bit_start": 0,
              "bit_end": 1,
              "description": "SBAS integrity used: 0 = Unknown, 1 = Integrity information is not available or SBAS integrity is not enabled, 2 = Receiver uses only GPS satellites for which integrity information is available"
            }
          ]
        }
      },
      {
        "name": "reserved0",
        "byte_offset": 10,
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "description": "Reserved",
        "reserved": true
      }
    ],
    "repeated_groups": [
      {
        "name": "sbassvs",
        "repetition_type": "count_field",
        "count_field": "cnt",
        "group_size_bytes": 12,
        "base_offset": 12,
        "fields": [
          {
            "name": "svid",
            "byte_offset": 0,
            "data_type": "U1",
            "description": "SV ID"
          },
          {
            "name": "reserved1",
            "byte_offset": 1,
            "data_type": "U1",
            "description": "Reserved",
            "reserved": true
          },
          {
            "name": "udre",
            "byte_offset": 2,
            "data_type": "U1",
            "description": "Monitoring status"
          },
          {
            "name": "svSys",
            "byte_offset": 3,
            "data_type": "U1",
            "description": "System (WAAS/EGNOS/...) same as SYS"
          },
          {
            "name": "svService",
            "byte_offset": 4,
            "data_type": "U1",
            "description": "Services available same as SERVICE"
          },
          {
            "name": "reserved2",
            "byte_offset": 5,
            "data_type": "U1",
            "description": "Reserved",
            "reserved": true
          },
          {
            "name": "prc",
            "byte_offset": 6,
            "data_type": "I2",
            "description": "Pseudo Range correction in [cm]",
            "unit": "cm"
          },
          {
            "name": "reserved3",
            "byte_offset": 8,
            "data_type": {
              "array_of": "U1",
              "count": 2
            },
            "description": "Reserved",
            "reserved": true
          },
          {
            "name": "ic",
            "byte_offset": 10,
            "data_type": "I2",
            "description": "Ionosphere correction in [cm]",
            "unit": "cm"
          }
        ]
      }
    ]
  }
}
